/*
 Update the devices array to include a new properties 
 used when rendering device list.
*/

// Titles and icons
const deviceTypes = {
	SMS: { title: "Text Message", icon: "mdi-comment-text-outline" },
	VOICE: { title: "Voice", icon: "mdi-phone-outline" },
	EMAIL: { title: "Email", icon: "mdi-email-outline" },
	TOTP: { title: "Authenticator App", icon: "mdi-cellphone" },
	FIDO2: { title: "Passkey", icon: "mdi-fingerprint" },
	PLATFORM: { title: "Biometrics", icon: "mdi-fingerprint" },
	MOBILE: { title: "Mobile", icon: "mdi-cellphone" },
	SECURITY_KEY: { title: "Security Key", icon: "mdi-usb-flash-drive" }
}

// Device types that require masking
const SMS = "SMS";
const VOICE = "VOICE";
const EMAIL = "EMAIL";
const SEPARATOR = " - ";

/**
 * Filters and processes a list of devices based on various criteria.
 * 
 * @param {Array<Object>} params.devices - An array of existing devices retrieved from PingOne MFA `Read all devices`.
 * @param {string} params.webAuthnSupport - The level of WebAuthn support ("NONE", "SECURITY_KEY_ONLY", etc.).
 * @param {string[]} params.allowedtypes (OPTIONAL) - An array of allowed device types retrieved from PingOne MFA `Read all devices`.
 * 
 * @returns {Object|boolean} - An object containing processed device information or `false` if no devices are available.
 */

module.exports = a = async ({ params }) => {
	let devices = params.devices;
	const webAuthnSupport = params.webAuthnSupport;
	const allowedtypes = params.allowedtypes;

	// If devices is not passed, head to error branch in flow
	if (!devices || devices.length === 0) {
		return false;
	}

	for (const d of devices) {
		if (d.type === SMS || d.type === VOICE) {
			d.maskedValue = maskPhone(d.phone);
		} else if (d.type === EMAIL) {
			d.maskedValue = maskEmail(d.email);
		}
		const nickname = d.nickname || "";
		const maskedValue = d.maskedValue || "";

		// Format nickname and masked value if available
		if (nickname && maskedValue) {
			d.displayText = `${nickname}${SEPARATOR}${maskedValue}`;
		} else if (!nickname && !maskedValue) {
			d.displayText = "";
		} else {
			d.displayText = `${nickname}${maskedValue}`;
		}

		// If too many requests have been made (daily), disable the device
		if (d.coolDownExpiresAt || d.lock?.status === "LOCKED" || d.block?.status === "BLOCKED") {
			d.disabledCSS = "DISABLED_DEVICE";
			if (d.coolDownExpiresAt) {
				d.disabledMessage = "You have exceeded the limit";
			} else if (d.lock?.status === "LOCKED") {
				d.disabledMessage = `Device is locked`;
			} else if (d.block?.status === "BLOCKED") {
				d.disabledMessage = `Device is blocked`;
			}
		}

		// Set the icon
		d.displayIcon = deviceTypes[d.type].icon || "";
		// Set the device type
		d.displayType = deviceTypes[d.type].title || "Unkown Device Type";
	}

	// Filter out devices if not supported by the running browser
	devices = filterWebAuthnSupportedDevices(webAuthnSupport, devices);

	// If allowed types is passed, filter out devices types that are not permitted
	if (allowedtypes) {
		devices = devices.filter(device => allowedtypes.includes(device.type));
	}
	// No devices
	if (devices.length === 0) {
		return false;
	}

	// Sort the devices based on type
	devices.sort((a, b) => a.displayType.localeCompare(b.displayType));

	return { 'devices': devices }
}

// Mask email
const maskEmail = (email) => {
	const [username, domain] = email.split("@");
	const maskedUsername =
		username.charAt(0) + "*".repeat(username.length - 2) + username.slice(-1);
	return maskedUsername + "@" + domain;
};

//Mask phone number
const maskPhone = (phone) => {
	const numericPhoneNumber = phone.replace(/[^\d+]/g, "");

	// Mask the first six digits of the phone number
	const maskedPhoneNumber = "***-***-" + numericPhoneNumber.slice(-4);

	return maskedPhoneNumber;
};

//Filter webAuthnSupport devices
const filterWebAuthnSupportedDevices = (webAuthnSupport, devices) => {
	// Filter out devices if not supported by the running browser
	if (webAuthnSupport === "NONE") {
		devices = devices.filter(
			(d) =>
				d.type !== "SECURITY_KEY" &&
				d.type !== "PLATFORM" &&
				d.type !== "TOTP" &&
				d.type !== "OTP"
		);
	} else if (webAuthnSupport === "SECURITY_KEY_ONLY") {
		devices = devices.filter((d) => d.type !== "PLATFORM");
	}

	return devices;
};

// Filter the selected device from the devices list
module.exports = a = async ({params}) => {
	const devices = params.devices;
	const selectedDeviceId = params.selectedDeviceId;

	if (!selectedDeviceId || !devices) {
		return false;
	}

	const device = devices.filter((d) => d.id === selectedDeviceId);

	if (device.length === 0) {
		return false;
	}
  return {'device': device}
};

